using System;using System.Linq;using System.Text;namespace EntidadesLayout.Ent {	[Serializable]	public class DurationAdjustmentAplicationForm	{		private Guid durationAdjustmentAplicationFormKey;		private double? percentage;		private Guid? aplicationFormFk;		private Guid? durationAdjustmentFk;		public DurationAdjustmentAplicationForm(){}		public Guid DurationAdjustmentAplicationFormKey		{			get { return durationAdjustmentAplicationFormKey; }			set { durationAdjustmentAplicationFormKey = value; }		}		public double? Percentage		{			get { return percentage; }			set { percentage = value; }		}		public Guid? AplicationFormFk		{			get { return aplicationFormFk; }			set { aplicationFormFk = value; }		}		public Guid? DurationAdjustmentFk		{			get { return durationAdjustmentFk; }			set { durationAdjustmentFk = value; }		}	}}
